import "./Navbar.scss";

const Navbar = () => {
  const user = true;
  return (
    <div className="navbar">
      <div className="left">
        <span>MERN-AUTH</span>
      </div>
      <div className="right">
        <div className="menubar">
          <div className="menuitem">
            <span>Home</span>
            <span>About</span>
        
            {user ? (
              <>
                <img src="Assets/avatar.png" alt="Profile Pic" />
                <span>Logout</span>
              </>
            ) : (
              <>
                <span>Login</span>
                <span>Register</span>
              </>
            )}
          </div>
        </div>
      </div>
    </div>
  );
};

export default Navbar;
